import React, { useState } from "react";

const Home = () => {
  const [location, setLocation] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");

  return (
    <div
      className="relative h-[90vh] w-full bg-cover bg-center flex items-center justify-center"
      style={{
        backgroundImage:
          "url('https://images.pexels.com/photos/7031409/pexels-photo-7031409.jpeg')",
      }}
    >
      {/* Dark Background Overlay */}
      <div className="absolute inset-0 bg-black/60"></div>

      {/* Content */}
      <div className="relative text-center text-white px-4">
        
        <h1 className="text-5xl font-bold mb-3 drop-shadow-md">
          Your Property, Our Priority
        </h1>

        <p className="text-xl opacity-90 mb-6">
          Find luxurious homes, rentals, and investment properties instantly.
        </p>

        {/* Search Block */}
        <div className="backdrop-blur-md bg-white/15 border border-white/20 shadow-lg rounded-xl p-5 flex flex-col md:flex-row items-center gap-4">

         

          {/* Location Input */}
          <input
            type="text"
            placeholder="Location"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="p-3 rounded-lg w-full md:w-48 bg-white/85 text-black"
          />

          {/* Start Date */}
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="p-3 rounded-lg w-full md:w-48 bg-white/85 text-black"
          />

          {/* End Date */}
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            className="p-3 rounded-lg w-full md:w-48 bg-white/85 text-black"
          />

          {/* Search Button */}
          <button className="bg-blue-600 hover:bg-blue-700 px-6 py-3 rounded-lg text-white font-semibold transition-all">
            Search
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
